Index: 
===================================================================
--- 
+++ 
@@ -0,0 +1,81 @@
+.header {
+  display: flex;
+  justify-content: space-between;
+  align-items: center;
+  padding: 16px;
+}
+
+.logo {
+  font-size: 1.5rem;
+  display: flex;
+  align-items: center;
+}
+
+.nav {
+  display: flex;
+  gap: 1rem;
+}
+
+.nav a {
+  text-decoration: none;
+  color: #333;
+  font-size: 1rem;
+}
+
+.nav a:hover {
+  text-decoration: underline;
+}
+
+.icons {
+  display: flex;
+  gap: 1rem;
+}
+
+.icons a {
+  color: #333;
+  font-size: 1.2rem;
+}
+
+.menuToggle {
+  display: none;
+  flex-direction: column;
+  gap: 0.3rem;
+  border: none;
+  background: none;
+}
+
+.menuToggle .menuIcon {
+  width: 25px;
+  height: 3px;
+  background-color: #333;
+}
+
+@media (max-width: 640px) {
+  .nav {
+    display: none;
+    flex-direction: column;
+    gap: 1rem;
+  }
+
+  .nav a {
+    font-size: 1.2rem;
+  }
+
+  .menuToggle {
+    display: flex;
+  }
+}
+
+@media (max-width: 320px) {
+  .header {
+    padding: 1rem;
+  }
+
+  .logo {
+    font-size: 1.2rem;
+  }
+
+  .icons a {
+    font-size: 1rem;
+  }
+}

